// youtube metrics
function createMetric(val, text, quantity) {
  return '<div class="metric"><span class="count_top" style="font-size: 13px;display: block;">'+ text +'</span>' +
    '<div class="count" style="font-size: 60px;font-weight: 600;">' + val.toLocaleString() + ' '+ quantity +'</div></div>';
}

