o = createMetric(Math.round(stats.mailchimp.meta.mails_recieved[1]/stats.mailchimp.meta.mails_sent[1] * 100), 'mails recieved', '%')
or = createMetric(Math.round(stats.mailchimp.meta.open_rate[1]/stats.mailchimp.meta.mails_recieved[1] * 100), 'mails opened', '%')
c = createMetric(stats.mailchimp.meta.unique_opens[1], 'each mail was opened uniquely', 'times')
$('#mailchimp-metrics').append(ca, s, or, c)

function makeMail(tweet) {
      var item = '<div class="social-item pad0 keyline-bottom">' + 
          '<a href="http://us10.campaign-archive2.com/?u=498429987654de03679e453a1&id='+tweet.uid+'">' +          
            '<span class="minutes">total link clicks <em>'+tweet['Total Clicks'].toLocaleString()+'</em></span>' + 
            '<span class="date">'+tweet["Send Date"]+'</span>' +
            '<p>'+tweet.Title+'</p>' +
            '</a>'
        '</div>'
        return item
}
stats.mailchimp.topMails.slice(0,5).forEach(function(x) {
  var item = makeMail(x)
  $('#top-mails').append(item)
})

